css:
.github-CommitDetailView {
  display: flex;
  flex-direction: column;
  height: 100%;
}
.github-CommitDetailView-header {
  flex: 0;
  border-bottom: 1px solid transparent;
  background-color: #282828;
}
.github-CommitDetailView-commit {
  padding: 12px;
  padding-bottom: 0;
}
.github-CommitDetailView-title {
  margin: 0 0 0.25em 0;
  font-size: 1.4em;
  line-height: 1.3;
  color: #f18260;
}
.github-CommitDetailView-avatar {
  border-radius: 0;
  height: 16px;
  margin-right: 0.4em;
  width: 16px;
}
.github-CommitDetailView-meta {
  display: flex;
  align-items: center;
  margin: 3px 0 12px 0;
}
.github-CommitDetailView-metaText {
  flex: 1;
  margin-left: 22.4px;
  line-height: 16px;
  color: rgba(255, 255, 255, 0.5);
}
.github-CommitDetailView-moreButton {
  position: absolute;
  left: 50%;
  transform: translate(-50%, -50%);
  padding: 0em 0.4em;
  color: rgba(255, 255, 255, 0.5);
  font-style: italic;
  border: 1px solid transparent;
  border-radius: 0;
  background-color: #282828;
}
.github-CommitDetailView-moreButton:hover {
  background-color: #353535;
}
.github-CommitDetailView-moreText {
  padding: 12px 0;
  font-size: inherit;
  font-family: var(--editor-font-family);
  word-wrap: initial;
  word-break: break-word;
  white-space: pre-wrap;
  border-top: 1px solid transparent;
  background-color: transparent;
  max-height: 55vh;
}
.github-CommitDetailView-moreText:empty {
  display: none;
}
.github-CommitDetailView-sha {
  flex: 0 0 7ch;
  margin-left: 12px;
  line-height: 16px;
  color: rgba(255, 255, 255, 0.5);
  font-family: var(--editor-font-family);
  white-space: nowrap;
  overflow: hidden;
}
.github-CommitDetailView-sha a {
  color: #5293d8;
}
